import "./Token.sol";

contract BuyInvoicesMainAPp {
    string public name = "EthSwap Fairtrader Main APp Testing";
    Token public token;
    //
    mapping(address => uint256) public stakes;

    address[] public stakers;
    Stakeholder[] public stakeholders;

    // event SmartContractOpenedBuyer(
    //     uint32 _id,
    //     string _termsAndCondition,
    //     string _warrantyFile,
    //     uint32 _apealTime,
    //     string _sellerWalletAddress,
