    //     address sellerOrUser
    // );

    struct OrderData {
        uint32 _orderId;
        uint256 _amount;
        string _termsAndCondition;
        string _warrantyFile;
        uint32 _apealTime;
        address _sellerWalletAddress;
        string _invoiceFile;
        string _customerEmail;
        uint32 _mediatorId;
        bool _medAccepted;
        string _superMedAcceptedEmail;
        string _judgeReport;
        string _judgeReportFile;
        string _judgeReportFileSuperMed;
        string _judgeReportSuperMed;
        uint32 _buyerTakeAmountInPercentSuperMed;
        uint32 _buyerTakeAmountInPercent;
        string _friendsEmail;
        string _appealTime;
        string _whoCalled;
        string _whoPaidMediatorFee;
        uint256 _mediatorFee;
        address _mediatorWalletAddress;
    }

    struct Stakeholder {
        address user;
        OrderData[] address_stakes;
    }

    constructor(Token _token) public {
        // constructor() public {
        stakeholders.push();
        token = _token;
    }

    function getBalance() external view returns (uint256) {
        return address(this).balance;
    }

    function exchangeHistoryOfStake()
        external
        view
        returns (Stakeholder[] memory)
    {
        return stakeholders;
    }

    function getAllOrdersOfOneUser(address _userAddress)
        external
        view
        returns (OrderData[] memory)
    {
        // require(/* mediator is calling not any other person for security purpose*/);
        uint256 index = stakes[_userAddress];
        return stakeholders[index].address_stakes;
    }

    function medAcceptNewCases(uint32 _index, address buyerWalletAddress)
        external
        returns (OrderData[] memory)
    {
        // require(/* mediator is calling not any other person for security purpose*/);
        uint256 index = stakes[buyerWalletAddress];
        stakeholders[index].address_stakes[_index]._medAccepted = true;

        return stakeholders[index].address_stakes;
    }

    function payMediatorFee(
        uint32 _index,
        address buyerWalletAddress,
        string memory _whoPaidMediatorFee,
        uint256 _mediatorFee,
        address mediatorWalletAddress
    ) public payable {
        // returns (OrderData[] memory)
        uint256 index = stakes[buyerWalletAddress];
        stakeholders[index]
            .address_stakes[_index]
            ._whoPaidMediatorFee = _whoPaidMediatorFee;
        stakeholders[index].address_stakes[_index]._mediatorFee = _mediatorFee;
        stakeholders[index].address_stakes[_index]._mediatorWalletAddress = mediatorWalletAddress;
        // return stakeholders[index].address_stakes;
    }

    function superMedAcceptNewCases(
        uint32 _index,
        address buyerWalletAddress,
        string memory _superMediatorEmail
    ) external {
        // require(/* mediator is calling not any other person for security purpose*/);
        uint256 index = stakes[buyerWalletAddress];
        stakeholders[index]
            .address_stakes[_index]
            ._superMedAcceptedEmail = _superMediatorEmail;
    }

    function medJudgeCaseReportSuperMed(
        string memory _judgeReport,
        string memory _judgeReportFile,
        address buyerWalletAddress,
        uint32 _index,
        uint32 _buyerTakeAmountInPercent
    ) external {
        // returns (OrderData[] memory)
        // require(/* mediator is calling not any other person for security purpose*/);
        uint256 index = stakes[buyerWalletAddress];
        stakeholders[index]
            .address_stakes[_index]
            ._judgeReportSuperMed = _judgeReport;
        stakeholders[index]
            .address_stakes[_index]
            ._judgeReportFileSuperMed = _judgeReportFile;
        stakeholders[index]
            .address_stakes[_index]
            ._buyerTakeAmountInPercentSuperMed = _buyerTakeAmountInPercent;

        uint256 amount = stakeholders[index].address_stakes[_index]._amount;
        uint256 mediatorFee = stakeholders[index].address_stakes[_index]._mediatorFee;
        address mediatorWalletAddress = stakeholders[index].address_stakes[_index]._mediatorWalletAddress;
        uint256 buyerTakeAmountInPercent = _buyerTakeAmountInPercent;
        address sellerWalletAddressOfContract = stakeholders[index]
            .address_stakes[_index]
            ._sellerWalletAddress;

        // ADDING CHECK THAT ONLY SELLER ADDRESS IS SAME IN CONTRACT OR SOMEOEN ELSE IS TRYING
        // string memory sellerAddress = stakeholders[index].address_stakes[_index]._sellerWalletAddress;
        // require(string(sellerWalletAddress) == sellerAddress);

        if (buyerTakeAmountInPercent == 100) {
            payable(buyerWalletAddress).transfer(amount);
        } else if (buyerTakeAmountInPercent == 50) {
            payable(buyerWalletAddress).transfer(amount / 2);
            payable(sellerWalletAddressOfContract).transfer(amount / 2);
        } else {
            uint256 sellerTakePercent = 100 - buyerTakeAmountInPercent;
            payable(buyerWalletAddress).transfer(
                (amount * buyerTakeAmountInPercent) / 100
            );
            payable(sellerWalletAddressOfContract).transfer(
                (amount * sellerTakePercent) / 100
            );
        }
            payable(mediatorWalletAddress).transfer(mediatorFee);


        // return stakeholders[index].address_stakes;
    }

    function medJudgeCaseReport(
        string memory _judgeReport,
        string memory _judgeReportFile,
        address buyerWalletAddress,
        uint32 _index,
        uint32 _buyerTakeAmountInPercent,
        string memory _appealTime
    ) external returns (OrderData[] memory) {
        // require(/* mediator is calling not any other person for security purpose*/);
        uint256 index = stakes[buyerWalletAddress];
        stakeholders[index].address_stakes[_index]._judgeReport = _judgeReport;
        stakeholders[index]
            .address_stakes[_index]
            ._judgeReportFile = _judgeReportFile;
        stakeholders[index]
            .address_stakes[_index]
            ._buyerTakeAmountInPercent = _buyerTakeAmountInPercent;
        stakeholders[index].address_stakes[_index]._appealTime = _appealTime;

        return stakeholders[index].address_stakes;
    }

    function payFeeForSuperMediator(
        uint256 _amount,
        string memory _whoIsCalling,
        uint32 _index,
        address buyerWalletAddress
    ) public returns (OrderData[] memory) {
        // User can't sell more tokens than they have
        require(token.balanceOf(msg.sender) >= _amount);

        uint256 index = stakes[buyerWalletAddress];
        stakeholders[index].address_stakes[_index]._whoCalled = _whoIsCalling;

        // Perform sale
        token.transferFrom(msg.sender, address(this), _amount);

        return stakeholders[index].address_stakes;
    }

    function payFeeForSuperMediatorr(uint256 _amount) public {
        // User can't sell more tokens than they have
        require(token.balanceOf(msg.sender) >= _amount);

        // Perform sale
        token.transferFrom(msg.sender, address(this), _amount);
    }

    function mediatorWithDrawFees(uint256 amount)
        external
    {
        payable(msg.sender).transfer(amount);
    }

    function userWithdrawTheirDisputesOrdersCash(
        address buyerWalletAddress,
        uint32 _index
    ) external returns (OrderData[] memory) {
        // require(/* mediator is calling not any other person for security purpose*/);
        uint256 index = stakes[buyerWalletAddress];

        uint256 amount = stakeholders[index].address_stakes[_index]._amount;
        uint256 buyerTakeAmountInPercent = stakeholders[index]
            .address_stakes[_index]
            ._buyerTakeAmountInPercent;
        address sellerWalletAddressOfContract = stakeholders[index]
            .address_stakes[_index]
            ._sellerWalletAddress;

        // ADDING CHECK THAT ONLY SELLER ADDRESS IS SAME IN CONTRACT OR SOMEOEN ELSE IS TRYING
        // string memory sellerAddress = stakeholders[index].address_stakes[_index]._sellerWalletAddress;
        // require(string(sellerWalletAddress) == sellerAddress);

        if (msg.sender == buyerWalletAddress) {
            if (buyerTakeAmountInPercent == 100) {
                payable(buyerWalletAddress).transfer(amount);
            } else if (buyerTakeAmountInPercent == 50) {
                payable(buyerWalletAddress).transfer(amount / 2);
            } else {
                payable(buyerWalletAddress).transfer(
                    (amount * buyerTakeAmountInPercent) / 100
                );
            }
        } else if (msg.sender == sellerWalletAddressOfContract) {
            if (buyerTakeAmountInPercent == 50) {
                payable(sellerWalletAddressOfContract).transfer(amount / 2);
            } else {
                uint256 sellerTakePercent = 100 - buyerTakeAmountInPercent;
                payable(sellerWalletAddressOfContract).transfer(
                    (amount * sellerTakePercent) / 100
                );
            }
        }

        return stakeholders[index].address_stakes;
    }

    function _addStakeholder(address staker) internal returns (uint256) {
        stakeholders.push();
        uint256 userIndex = stakeholders.length - 1;
        stakeholders[userIndex].user = staker;
        stakes[staker] = userIndex;
        return userIndex;
    }

    function _saveOrdersDataOfUser(
        uint32 _orderId,
        uint256 _amount,
        string memory _termsAndCondition,
        string memory _warrantyFile,
        uint32 _apealTime,
        address _sellerWalletAddress,
        string memory _invoiceFile,
        string memory _customerEmail,
        uint32 _mediatorId,
        bool _medAccepted,
        string memory _friendsEmail
    ) public {
        // Check that the requested amount of tokens to sell is more than 0
        // require(_sellerWalletAddress == '', "seller Wallet Address Cannot nothing");

        uint256 index = stakes[msg.sender];
        if (index == 0) {
            index = _addStakeholder(msg.sender);
        }

        stakeholders[index].address_stakes.push(
            OrderData(
                _orderId,
                _amount,
                _termsAndCondition,
                _warrantyFile,
                _apealTime,
                _sellerWalletAddress,
                _invoiceFile,
                _customerEmail,
                _mediatorId,
                _medAccepted,
                "",
                "",
                "",
                "",
                "",
                0,
                0,
                _friendsEmail,
                "",
                "",
                "",
                0,
                // dummy Address of mediator
                0x2e50a8e498912EF9818F080A43f849C4a58c1A66
            )
        );
    }

    function buyWithFTP(
        uint32 _orderId,
        uint256 _amount,
        string memory _termsAndCondition,
        string memory _warrantyFile,
        uint32 _apealTime,
        address _sellerWalletAddress,
        string memory _invoiceFile,
        string memory _customerEmail,
        uint32 _mediatorId,
        bool _medAccepted,
        string memory _friendsEmail
    ) public {
        // User can't sell more tokens than they have
        require(token.balanceOf(msg.sender) >= _amount);

        // Perform sale
        token.transferFrom(msg.sender, address(this), _amount);

        _saveOrdersDataOfUser(
            _orderId,
            _amount,
            _termsAndCondition,
            _warrantyFile,
            _apealTime,
            _sellerWalletAddress,
            _invoiceFile,
            _customerEmail,
            _mediatorId,
            _medAccepted,
            _friendsEmail
        );
    }

    // function buyWithUsdt(
    //     uint32 _orderId,
    //     uint256 _amount,
    //     string memory _termsAndCondition,
    //     string memory _warrantyFile,
    //     uint32 _apealTime,
    //     address _sellerWalletAddress,
    //     string memory _invoiceFile,
    //     string memory _customerEmail,
    // uint32 _mediatorId,
    // bool _medAccepted,
    //     string memory _friendsEmail
    // ) public {
    //     // User can't sell more tokens than they have
    //     require(usdtToken.balanceOf(msg.sender) >= _amount);

    //     // Perform sale
    //     usdtToken.transferFrom(msg.sender, address(this), _amount);

    //     _saveOrdersDataOfUser(
    //         _orderId,
    //          _amount,
    //         _termsAndCondition,
    //         _warrantyFile,
    //         _apealTime,
    //         _sellerWalletAddress,
    //         _invoiceFile,
    //         _customerEmail,
    // _mediatorId,
    // _medAccepted,
    //         _friendsEmail
    //     );
    // }

    function buyWithBNB(
        uint32 _orderId,
        string memory _termsAndCondition,
        string memory _warrantyFile,
        uint32 _apealTime,
        address _sellerWalletAddress,
        string memory _invoiceFile,
        string memory _customerEmail,
        uint32 _mediatorId,
        bool _medAccepted,
        string memory _friendsEmail
    ) public payable {
        // User can't sell more tokens than they have
        // require(token.balanceOf(msg.sender) >= msg.value);

        // Perform sale
        // token.transferFrom(msg.sender, address(this), _amount);
        // address(address(this).transfer(_amount));
        // token.transfer(address(this), _amount);
        // token.transferFrom(msg.sender, address(this), _amount);

        _saveOrdersDataOfUser(
            _orderId,
            msg.value,
            _termsAndCondition,
            _warrantyFile,
            _apealTime,
            _sellerWalletAddress,
            _invoiceFile,
            _customerEmail,
            _mediatorId,
            _medAccepted,
            _friendsEmail
        );
    }
}
